from fastapi import APIRouter
from fastapi.responses import StreamingResponse

from openai import OpenAI

# import time
import json

router = APIRouter()
client = OpenAI()

uml_diagram_base_64 = """data:image/png;base64,"""


def request_open_ai(as_stream=True):

    openai_response_stream = client.chat.completions.create(
        model="gpt-4o",
        stream=as_stream,
        messages=[
            {
                "role": "user",
                "content": [
                    {"type": "text", "text": "Generate me a GraphQL code schema based on this uml diagram"},
                    {
                        "type": "image_url",
                        "image_url": {
                            "url": uml_diagram_base_64
                        },
                    },
                ],
            }
        ],
        max_tokens=700,
    )

    return openai_response_stream


@router.get("/openai-stream-response")
def openai_stream_response():
    def event_stream_iterator(stream):
        for chunk in stream:
            print('chunk = ', chunk)

            for choice in chunk.choices:
                stream_data_chunk = choice.delta.content
                if stream_data_chunk != None:
                    yield "id: test\n" + "event: my_custom_event\n" + "data: " + stream_data_chunk + "\n\n"

    openai_response_stream = request_open_ai()
    return StreamingResponse(
        event_stream_iterator(openai_response_stream),
        media_type="text/event-stream"
    )


@router.get("/openai-normal-response")
def open_api_normal_response():
    openai_normal_response = request_open_ai(as_stream=False)

    print('openai_normal_response = ', openai_normal_response)
    print('openai_normal_response.choices[0] = ',
          openai_normal_response.choices[0].message.content)

    return json.dumps({
        "message": openai_normal_response.choices[0].message.content
    })
